contracts/main.sol.content:
pragma solidity ^0.8.0;

import "./member.sol";
import "./item.sol";


contract Supplychain{
    event itemcreated(uint upc, address _address);
    event openForSale(uint upc);
    event orderPlaced(uint upc , address _address);
    event shipped(uint upc,address _address);
    


}

contracts/item.sol.content:
pragma solidity ^0.8.0;

contract Item{
   uint ic=0;
   enum state{
       AtSupplier,
       ForSale,
       Ordered,
       shipped,
       atqualitycheck,
       returnedback,
       recievedByManufacture
   }
   struct item{
       string product_name;
       uint productId;
       address itemOwner;
       state itemState;
       uint cost;
       
   }
   mapping(uint=>item) public Items;


}

contracts/member.sol.content:
pragma solidity ^0.8.0;

contract participant{
    uint pc=0;
    enum user_type{
        supplier,
        transporter,
        quality_checker,
        manufacturer
    }

    struct participant{
        string username;
        uint userId;
        user_type utype;
        address user_address;
        uint money;
    }
    mapping(uint=>participant) public participants;
    mapping(address=>participant) participantsId;
}

